import { faCoffee } from '@fortawesome/free-solid-svg-icons'

function Card() {
  const btn = <FontAwesomeIcon icon={faCoffee} />
  return (
    <div className="Card">
      <p class="text">
        <button class="reminder-btn">{btn}</button>
      </p>
    </div>
  );
}

export default Card;
